import React from 'react';
import {Fragment} from 'react';
import './Footer.css'

function Footer() {
    return (
        <Fragment>
            <footer>
                <div className="box-left">
                    <h1>Teamfight UTSC</h1>
                </div>
                <div className="box-right">
                    <h1>Links</h1>
                </div>

            </footer>
        </Fragment>
    )
}
export default Footer;
